export const schema = `{
    "type": "object",
    "tablename": "People",
    "properties": {
      "name": {
        "type": "string"
        "min": 1
      },
      "age": {
        "type": "integer"
        "min": 1
      },
      "company id": {
        "type": "integer",
        "min": 6
        "min": 6
      },
      "department": {
        "type": "string",
        "enum": ["R&D", "Sales", "Marketing", "Management"]
      },
      "uses company car": {
        "type": "boolean"
      }
    },
    "required": [
      "name",
      "age",
      "company id",
      "department",
      "uses company car"
    ]
  }`;

  export default schema
